import React from 'react';

import './index.css';

function Cards(props) {
    console.log(props)
    return (

        <div>
            <div className="cardblock">
                <span className="zoom">  <a href={props.links}> <img src={props.imgsrc} alt="Netflix Properties" /></a></span>
                <h3 style={{textAlign:'center'}}>{props.sname}</h3>
            </div>
        </div>
    );
}

export default Cards;
